CREATE DATABASE pokemon;

USE pokemon;

/*This table lists all the pokemon
	id = The unique id for each pokemon (generally follows pokedox number with the exception of subspecies)
    pokemon_name = pokemon name
    species = this number is the exact pokedex number (Subspecies have different ids)
    height = Pokemon Height
    weight = pokemon weight
    is_default = states whether the pokemon is the base species (1) or a subspecies (2)*/
CREATE TABLE pokemon(
	id INTEGER(11) NOT NULL,
	pokemon_name VARCHAR(500) NOT NULL,
    height INTEGER(5) NOT NULL,
    weight INTEGER(5) NOT NULL,
    base_experience INTEGER(5) NOT NULL,
    is_default INTEGER(5) NOT NULL,
    PRIMARY KEY (id)
);

