/*This table list all the different type possibilities for pokemon
	id = The unique id for each type
    identifier = the actual word name for the type
    generation_id = the pokemon generation which the type was introduced*/
CREATE TABLE types(
	id INTEGER(11) NOT NULL,
	identifier VARCHAR(500) NOT NULL,
	generation_id INTEGER(5) NOT NULL,
    PRIMARY KEY (id)
);

INSERT INTO `types` VALUES (1,'normal',1),(2,'fighting',1),(3,'flying',1),(4,'poison',1),(5,'ground',1),(6,'rock',1),(7,'bug',1),(8,'ghost',1),(9,'steel',2),(10,'fire',1),(11,'water',1),(12,'grass',1),(13,'electric',1),(14,'psychic',1),(15,'ice',1),(16,'dragon',1),(17,'dark',2),(18,'fairy',6),(10001,'unknown',2),(10002,'shadow',3);

/*This is an intermediate table that ties all the pokemon to their types
	pokemon_id = The unique id for each pokemon just like the pokemon table(generally follows pokedox number with the exception of subspecies)
    type_id = the unique id for each type just like the types table*/
CREATE TABLE pokemon_types(
	pokemon_id INTEGER(11) NOT NULL,
	type_id INTEGER(5) NOT NULL,
    PRIMARY KEY (pokemon_id)
);

